import React from 'react';
import './NavBar.css';

class NavBar extends React.Component {
    render() {
        return (
            <div className="nav-body">
                <div className="nav-logo">
                    Logo
                </div>
                <div className="nav-items">
                    Content
                </div>
            </div>
        )
    }
}

export default NavBar;
